Titulo:
SERVIÇO CUJO CONTRATO FOI REVOGADO COM A FIRMA CCM BRASIL PELO DECRETO MUNICIPAL Nº 003/2013 DE 03/01/2013;
Serviços de Limpeza Urbana em toda área urbana do Município de Ribeirão-PE:
1) Varrição de vias urbanas pavimentadas e logradouros públicos;
2) Coleta e transporte de lixo domiciliar;
3) Coleta e transporte de lixo de resíduos volumosos (entulhos, resíduos de construção civil e animais de pequeno porte);
